import React from 'react';
import Titulo from './components/titulo';
import datos from './mocking/perfiles';
class App extends React.Component{
  render(){
    return (
      <div>
        <select name="perfil">
          {
          datos.map(obj =>{
            return(
              <option id={obj.id}>{obj.nombre}</option>
            )
          })
          }
        </select>
        <Titulo cabecera="Hola" cuerpo="Chao"></Titulo>        
      </div>
    );
  }
}

export default App;
